{"4": ["На 8й день отвалилось ушко на цепочке, не восстановить. ", "2020-06-03T03:59:40.251414651Z", "серебристый", "25.0", 3, 0, 3, "Браслет на ногу \"Снейк\"", "Lucente"], "6": ["Сама цепочка довольно толстая, на ноге смотрится нормально, крепление очень плохое. Выкупила, принесла домой, примерила 1 раз, крепление отвалилось. Возврат возможен только при проведении экспертизы, побегала по ювелирным города, ни кто не хочет делать экспертизу. Так и закончился срок для оформления возврата. Расстроилась, так и лежит порванный, за ремонт берут больше, чем стоил браслет. Может кому то мой отзыв будет полезен.", "2020-12-12T07:09:28Z", "серебристый", "27.0", 10, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "7": ["Хороший прочный браслет, все лето носила, но мне великоват оказался", "2020-10-24T22:05:47Z", "серебристый", "26.0", 0, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "8": ["Очень нравится браслет. Смущает пайка. Как девочки писали, что у многих рвётся. Боялась даже носить. Относила к одному, и ко всторому ювелиру. Один скала, не буду переделывать, всё норм. Второй что-то наплёл о том, что нарушиться верхний слой и почернеет. Чушь, а то серебро паянное чернеет)\r\nПлюнула и ношу. Терять не хочется, а как по другому, чёрт его знает. Может кто поделиться опытом, как быть?", "2020-09-21T20:07:29Z", "серебристый", "21.0", 5, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "10": ["С виду приличный, размер выбрала 26, на тонкую ногу, свисает отлично! Крепления к браслету не очень надежно смотрятся, посмотрим на сколько хватит! Не все подвески пролезают в круглое ушко! Пока все нравиться! ", "2020-09-08T07:02:55Z", "серебристый", "26.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "11": ["Через 3 месяца порвался там где пайка.  Отдала в ремонт. Качество браслета слабенькое, не советую покупать. Ненадолго хватит.", "2020-08-29T19:17:10Z", "серебристый", "25.0", 2, 0, 1, "Браслет на ногу \"Снейк\"", "Lucente"], "14": ["Браслет классный, не тонкий. НО! Одноразовый, пайка на концах сделана не качественно, отвалится быстро. Поэтому отказ! Пожелания производителю: сделать  пайку по кругу!", "2020-08-13T06:17:21Z", "серебристый", "28.0", 1, 0, 3, "Браслет на ногу \"Снейк\"", "Lucente"], "16": ["Браслет смотрится очень красиво, блестит, взяла на размер больше, чтобы свободно свисал. За такую цену, рекомендую. Спасибо производителю", "2020-05-20T16:16:46.49542911Z", "серебристый", "26.0", 1, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "17": ["В меру тяжелая, удобная. 26 размер подошёл как и хотела, чуть свободно.", "2020-05-14T12:16:01.615920727Z", "серебристый", "26.0", 3, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "18": ["Капец! А где изделие?? У меня тоже пустая коробочка!!!! Не то слово, повеситься... Кому претензии то???", "2020-05-12T21:02:03.480600393Z", "серебристый", "25.0", 3, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "20": ["Браслет отличный размер свободный на ноге ничего не жмет", "2020-05-07T15:57:10.73768165Z", "серебристый", "25.0", 1, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "21": ["Браслет хороший, цена после покупки мной браслета подешевела на 63 рубля( мелочь, но неприятно. В комплекте шла коробочка с логотипом магазина, все отлично посмотрим как будет носиться)", "2020-04-18T14:02:41.907889734Z", "серебристый", "25.0", 5, 5, 4, "Браслет на ногу \"Снейк\"", "Lucente"], "22": ["Хорошая цепочка на щиколотку. Смотрится достойно. ", "2020-04-15T14:51:26.131381509Z", "серебристый", "25.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "23": ["Браслет классный и цепочка отличная. Но сильно мне велика.... Не пойму, как толком ногу измерить))) Надо сантиметра на 2 меньше. Очень жаль...(((", "2020-03-23T21:20:01.311367835Z", "серебристый", "24.0", 0, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "24": ["Ширина Ноги 21 см, взяла  24- очень удобно", "2020-03-12T18:27:05.650026829Z", "серебристый", "24.0", 2, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "25": ["Вот прям клёвенький! И добавить нечего!", "2020-02-29T15:39:38.738802044Z", "серебристый", "25.0", 7, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "26": ["Хорошенький браслетик. Понравился", "2020-02-16T09:56:22.902022117Z", "серебристый", "23.0", 0, 3, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "27": ["Брала 24 и 25.На лодыжку 23 см забрала 25-она \"упала\" ниже и нагрузки на нее(на разрыв) нет.Цепь красивая,в меру толстая, чтобы быть заметной, но не вычурной.", "2020-02-13T14:48:08.66629592Z", "серебристый", "25.0", 5, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "28": ["Браслет купила на 2 см больше, подошёл супер, натяжки нет, на ноге не чувствуется совершенно. Ношу 4 месяца, не снимаю даже в душе. 1 раз чистила и он опять блестит как новенький. Очень понравился, рекомендую.", "2020-01-12T01:57:38.869447023Z", "серебристый", "26.0", 9, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "29": ["хороший браслет, за 464 ру. вообще супер, не хлипкий.", "2020-01-10T13:01:43.102159968Z", "серебристый", "24.0", 3, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "30": ["Серебро. Всё супер.", "2019-12-26T14:00:31.130463245Z", "серебристый", "24.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "31": ["Очень понравился браслет, отлично смотрится. Взяла на 3 см больше, чтобы движение не сковывало, идеально. Купила за 473 руб. Спасибо магазину ", "2019-12-06T13:12:53.832729304Z", "серебристый", "25.0", 8, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "32": ["Брала как браслет на ногу. Идеален.", "2019-12-02T15:12:20.350388101Z", "серебристый", "27.0", 3, 3, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "33": ["брала браслет на ногу, размер 23 подошел идеально. упакован был в подарочную упаковку, внутри мешочек. все в отличном состоянии. покупкой довольна.", "2019-11-21T00:03:19.150046589Z", "серебристый", "23.0", 1, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "34": ["Взяла на 1размер больше, чем отмерила ногу, получилось как раз, очень рада)", "2019-11-17T22:42:12.318182325Z", "серебристый", "25.0", 4, 2, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "35": ["Длина снека 23 см, окружность голеностопа  - 22 см. Замок хороший.", "2019-11-03T06:08:40.032026698Z", "серебристый", "23.0", 24, 6, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "36": ["Боялась заказывать, т.к. много отрицательных отзывов, но очень хотела такой браслет. Долго не могла определиться какой р-р заказать, обхват моей ноги 21см, надела браслет мужа на ногу (23см) походила по дому и поняла, что мне неудобно, нога более подвижная часть, чем рука, поэтому правило +2см к браслету на ногу не применимо. Думаю, надо брать +3см. Я решила заказать 25р-р, можно было и 24 р-р, не знаю будет ли удобно если я решу надеть подвеску(провисание большое). Зато мой браслет успешно прошёл проверку, носила вообще не снимая со дня покупки (8.10), купалась, спала, надевала носки, сапоги носила - не порвался, не пожелтел, не почернел, не изменился в размере. Сегодня решила снять до лета и оставить положительный отзыв. Очень довольна браслетом, советую. Порадовала комплектация, приятно получать товар в таком виде - фирменная коробочка, салфетка. Перед заказом измеряйте обхват ноги в самом тонком месте +3см, это и будет оптимальный р-р браслета, иначе при ходьбе быстро порвётся.", "2019-10-26T21:49:29.806178207Z", "серебристый", "25.0", 46, 2, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "37": ["Очень красивый браслет, качественный. Даже если он порвётся, что 50-100 руб.для спайки не жалко). Брала на момент покупки 23, но можно было бы 22 размер взять, но не было уже. К браслету купила подвеску бабочку и жду лета). Обошлась эта красота 216 руб.брастет и 223 руб. подвеска.", "2019-10-17T15:06:10.643696817Z", "серебристый", "23.0", 7, 3, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "38": ["Добавлю фото)", "2019-10-17T15:55:39.103855724Z", "серебристый", "23.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "40": ["Пока восторг!😍👍 Тяжелая, кайф. Как порвется, напишу😅 250₽", "2019-09-27T12:48:28.446768796Z", "серебристый", "22.0", 26, 5, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "41": ["Браслет порвался через неделю после носки", "2019-09-25T09:37:59.976713038Z", "серебристый", "27.0", 9, 4, 1, "Браслет на ногу \"Снейк\"", "Lucente"], "42": ["хороший браслет,посмотрим как будет в носке", "2019-09-03T19:17:14.886975745Z", "серебристый", "28.0", 7, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "44": ["Жуткое качество. Порвался через неделю. Это не серебро!", "2019-09-23T13:14:35.464910062Z", "серебристый", "28.0", 6, 3, 2, "Браслет на ногу \"Снейк\"", "Lucente"], "45": ["Браслет смотреться очень красиво, забрала, но по отзывам при носке рвется у застежки, напишу", "2019-09-21T07:11:53.324850693Z", "серебристый", "22.0", 1, 5, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "46": ["Очень хороший браслет. Пришел в коробочке. Размер подошёл и совпал с заявленным", "2019-03-15T11:34:35.313779173Z", "серебристый", "25.0", 1, 1, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "48": ["Блестит, ношу с удовольствием, советую", "2019-09-16T18:22:38.918731942Z", "серебристый", "26.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "49": ["Отвратительный браслет!!!! Сломался сразу же. Выкупила его, вроде смотрела, все было хорошо, но, как только пришла домой, раскрыла коробку, а замок сломан. Сделать конечно можно, но это дополнительные деньги  и время. Не советую к покупке! (((", "2019-09-16T11:49:25.073942625Z", "серебристый", "27.0", 5, 4, 1, "Браслет на ногу \"Снейк\"", "Lucente"], "50": ["Крутой браслет! Очень красиво смотрится на ноге, но единственное не поняла, как будто чуть-чуть растянулся с первого дня покупки(прошло 3 дня как я его ношу)", "2019-08-31T20:43:55.836785333Z", "серебристый", "25.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "51": ["Очень понравился, красивый, плетением довольна и что тут говорить.. Снек.. Выигрывает!!!! Цена вообще сказка 416р. Спасибо..", "2019-08-28T14:12:26.607954568Z", "серебристый", "28.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "52": ["пришел в размер на ноге смотриться красиво невесомый", "2019-08-26T04:38:11.104458688Z", "серебристый", "27.0", 2, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "53": ["Браслет порвался в области скрепления цепочки и ушка на второй день покупки ", "2019-08-25T17:06:04.800864992Z", "серебристый", "27.0", 3, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "54": ["Порвался через 5 дней, выброшенные деньги", "2019-08-25T11:26:40.986715845Z", "серебристый", "25.0", 4, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "55": ["Суперски все в отличном состоянии", "2019-08-23T10:19:59.5958325Z", "серебристый", "24.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "56": ["Браслет вполне оправдал ожидания. На ноге чувствуется вес.", "2019-08-21T18:01:54.803626158Z", "серебристый", "25.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "57": ["Браслет очень понравился. Блестит. Соответствует размеру. Посмотрим, как поведёт себя после носки.", "2019-08-13T16:02:22.607907036Z", "серебристый", "24.0", 6, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "58": ["Обхват ноги 25 см, 27 в самый раз)) 26 взяла подружке, очень довольна у неё щиколотка потоньше))", "2019-07-23T15:54:05.447823287Z", "серебристый", "27.0", 2, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "59": ["Цепочка красивая,блестит", "2019-07-12T17:07:31.313939614Z", "серебристый", "26.0", 1, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "60": ["Порвалась через неделю ", "2019-05-26T08:27:11.983094946Z", "серебристый", "25.0", 3, 0, 1, "Браслет на ногу \"Снейк\"", "Lucente"], "61": ["Девушки, подумайте, прежде чем заказывать. Останетесь без цепочки и деньги вам не вернут) прошло 2,5 месяца, цепочка разошлась в двух местах", "2019-05-01T06:06:48.458555624Z", "серебристый", "22.0", 23, 2, 1, "Браслет на ногу \"Снейк\"", "Lucente"], "62": ["Очень красивая цепочка! Выглядит дорого", "2019-04-11T13:20:20.084519595Z", "серебристый", "24.0", 1, 4, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "63": ["Обычный тоненький браслет. На 23 взяла 24 размер.", "2019-03-13T11:17:23.011798676Z", "серебристый", "24.0", 16, 0, 4, "Браслет на ногу \"Снейк\"", "Lucente"], "65": ["Браслет хороший , серебро светлое блестит, размеру соответствует.но в комплекте должна быть подарочная коробка , брала два браслета и не у одного коробки не было как так?🤷‍♀️", "2019-03-07T15:15:14.191593436Z", "серебристый", "22.0", 3, 0, 5, "Браслет на ногу \"Снейк\"", "Lucente"], "66": ["Внешне брамлет смотрится хорошо, но на 4-й день он порвался, на фото видно как. На что в wildberries предложили мне обратиться самостоятельно в независимую экспертизу, получается гарантийный срок здесь не распростроняется.  И браслет меня очень разочаровал и работа магазина тоже.", "2019-03-04T15:57:15.437254797Z", "серебристый", "26.0", 25, 3, 1, "Браслет на ногу \"Снейк\"", "Lucente"], "67": ["Очень красивый браслет, толстенький, блестит. На 26 см взяла 27, то что надо ", "2019-02-22T18:47:31.106836482Z", "серебристый", "27.0", 27, 5, 5, "Браслет на ногу \"Снейк\"", "Lucente"]}
